    [],nt"revision_timestamp": "2016-07-27T22:55:25.818224",nt"name": "kulm-wetland-management-district-annual-narrative-report-calendar-year-1985",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Kulm WMD,
    Bonehill NWR, Maple River NWR, and Dakota Lake NWR outlines Refuge accomplishments
    during the 1985 calendar year. The report begins with a summary of the year's highlights
    and weather conditions. Land acquisition is covered. The report includes a planning
    section which discusses management planning, compliance with environmental and cultural
    resource mandates, and research and investigations. Refuge administration is outlined;
    information about personnel, youth programs, manpower programs, volunteer programs,
    funding, and safety is given. Habitat management is also covered; subjects include
    wetlands, forests, croplands, grasslands, grazing, haying, fire management, pest
    control, and WPA easements. The wildlife section of the report discusses endangered
    and threatened species, waterfowl, marsh birds and waterbirds, shorebirds, game
    mammals, wildlife propagation, animal control, and disease control. The public uses
    of the Refuge described in this report include outdoor classrooms, interpretive
    programs, hunting, trapping, outdoor recreation, and law enforcement. The equipment
    and facilities section of the report provides information about new construction,
    major maintenance, equipment replacement, and communication systems. Cooperative
    programs and items of interest are provided at the end. Refuge brochures are attached.",nt"license_title":
